import React from 'react';
import {Container, Content} from './styles'
import Navbar_Component from '../../components/navbar'

function HomePage(){
  return(
    <>
      <Container>
        <Navbar_Component/>
        <Content>
          <h1>Página Home</h1>
          <div></div>
        </Content>
      </Container>
    </>
  )

}

export default HomePage;
